function Third() {
  return (
  <div >
      <Wrapper style={{ background: '#ECECEC', padding: '20px', alignContent: 'center', opacity: .4  }} className="container">
      <span>Third</span>
      <section>
        <p>
          Curabitur eu feugiat magna, ut malesuada est.
          {/* omitted */}
        </p>
