    </Wrapper>
    <div  style={{position:'fixed', right:0, bottom:0}}>
   <Row>
   <h1>Want .</h1>
 <Link style={{display: 'inline-block'}} to="/second">Sign-Up</Link>
 </Row>
 </div>
  </div>
  );
}

const Wrapper = styled.div`
    /* omitted */
`;

export default Third;
